import axios from "axios"

const fetchImage = (value, page) => {
    // console.log('get for fetch', value)


    return axios
        .get(`https://pixabay.com/api/?q=cat&page=1&key=19685928-f191ac91b9da632ea9a4b744f&image_type=photo&orientation=horizontal&per_page=12`).then(res => (console.log(res)))
}

export default fetchImage;
